// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";

contract CoalMine {
    IERC721 public minerMinter;
    address public owner;

    struct Stake {
        uint256 minerId;
        uint256 timestamp;
    }

    mapping(address => Stake) public stakes;

    constructor() {

    }

    modifier isOwner(address _addr) {
        require(_addr == owner);
        _;
    }

    function setMinerContract(address _addr) public isOwner(msg.sender) {
        minerMinter = IERC721(_addr);
    }

    function stake(uint256 _minerId) public {
        require(stakes[msg.sender].minerId == 0, "already staked");
        stakes[msg.sender] = Stake(_minerId, block.timestamp);
        minerMinter.safeTransferFrom(msg.sender, address(this), _minerId);
    }

    function unstake() public {
        require(stakes[msg.sender].minerId > 0);
        minerMinter.safeTransferFrom(address(this), msg.sender, stakes[msg.sender].minerId);
        delete stakes[msg.sender];
    }

    function onERC721Received(
        address operator,
        address from,
        uint256 id,
        uint256 value,
        bytes calldata data
    ) external pure returns (bytes4) {
        return bytes4(keccak256("onERC721Received(address,address,uint256,uint256,btes)"));
    }
}
